import React, { Component } from 'react'
import "./texteng.css";

export class IntroEng extends Component {
  render() {
    return (
        <div className='m-10'>
            <div className='text-xs font-light font-grotesk'>ENG</div>
            <div className='text-base'>I work based in Seoul.</div>

        </div>
    )
  }
}

export default IntroEng
